import React, { Component } from 'react'
import PasswordRecoveryHead from './PasswordRecoveryHead'
import PasswordRecoveryMid from './PasswordRecoveryMid'

class PasswordRecovery extends Component {
    render() {
        return (
            <div className="wrapper">
                <PasswordRecoveryHead />
                <PasswordRecoveryMid props={this.props.props}/>
            </div>
        )
    }
}
export default PasswordRecovery
